num_frames = 200
num_ccds = 112
fov = 2.0

class HyperSuprimeCamDR(SuprimeCamDR):

    def __init__(self, logger=None):
        super(HyperSuprimeCamDR, self).__init__(logger=logger)

        self.pfx = 'T'
        self.num_frames = num_frames
        self.num_ccds = num_ccds
        self.inscode = 'HSC'
        self.fov = fov
        self.frameid_offsets = frameid_offsets

    # Until HSC FITS headers are fixed
    #
    def get_regions(self, image):
        ccd_id = int(image.get_keyword('DET-ID'))
        return hsc_ccd_data[ccd_id]


